import { gql, TypedDocumentNode } from "@apollo/client";
import { useQuery } from "@apollo/client/react";
import { GetTodoQuery, GetTodoQueryVariables } from "./generated/query-type";


const GET_TODO_QUERY: TypedDocumentNode<GetTodoQuery, GetTodoQueryVariables> =  gql`
	query GetTodo ($ID: String) {
		getTodo (ID: $ID) {
			title

			completed

		}
	}

`;


const App = () => {


	const { data } = useQuery(GET_TODO_QUERY, { variables: { ID: "1" } } );


	return <>

		<p>{ data?.Todo?.title }</p>

		{ data?.Todo?.completed ? <p>completed</p> : <p>uncompleted</p> }
	</>

}


export default App;

